import React from "react";

const NavBar = () => {
  return (
    <nav>
      <ul>
        <li className="fa-solid fa-house"></li>
        <li className="fa-solid fa-book"></li>
        <li className="fa-solid fa-house"></li>
        <li className="fa-solid fa-house"></li>
      </ul>
    </nav>
  );
};

export default NavBar;
